import { StyleSheet, Text, View, ScrollView } from 'react-native'
import { Provider as PaperProvider } from 'react-native-paper'
import {HeaderComponent} from './src/components/HeaderComponent'
import {CardComponent} from './src/components/CardComponent'
const customData = require('./src/api/customData.json')


const App = () => {

  return (
<PaperProvider>
      <Appbar.Header style={{ margin: 10 }}>
        <Appbar.Content title="Activity tracker" />
        <Avatar.Text size={50} label="NP" style={{ borderWidth: 2 }} />
      </Appbar.Header>
      <Title>Home</Title>
      <ScrollView>
        {customData.map((item, index) => {
          return (
            <Card key={index} mode="outlined" style={{ marginVertical: 10 }}>
              <Card.Title title={item.title} subtitle={item.date} />
              <Card.Content
                style={{
                  flexDirection: 'row',
                  justifyContent: 'space-between',
                }}
              >
                <Text>Distance : {item.distance} km</Text>
                <Text>Dur√©e : {item.duration}</Text>
              </Card.Content>
              <Card.Cover source={{ uri: 'https://picsum.photos/700' }} />
            </Card>
          )
        })}
      </ScrollView>
    </PaperProvider>
  )
}

export default App
